import React from 'react'

export default () => {

    const createcolumns = () => {
        const column = []
        for(let i=0; i<=30; i++) {
            let classnames = [`column c${i}`]
            column.push(<div className={classnames}></div>)
        }

        return column
    }

    const createrows = (rowNum) => {
        return ( 
            <div className={rowNum}> 
                {createcolumns()} 
            </div>
        )
    }

    return (
        <div className='grid'>

            {createrows('row1')}
            {createrows('row2')}
            {createrows('row3')}
            {createrows('row4')}
            {createrows('row5')}
            {createrows('row6')}
            {createrows('row7')}
            {createrows('row8')}
            {createrows('row9')}
            {createrows('row10')}
        </div>
    )

}
